    false,nt"url": null,nt"notes": "This dataset contains physical sample data
    compiled by the New Mexico Bureau Geology and Mineral Resources, and published as
    a Web feature service for the National Geothermal Data System. Fields in the Physical
    Sample Content Model will become XML elements in interchange documents for WMS simple
    features provided by a node in the USGIN network. Each feature includes a Specimen
    Label, Geologic unit name, specimen type, date collected and Source. The dataset
    is spatially referenced to EPSG: 4326 (for interoperability). The data contained
    in the submitted dataset is available as an Excel Spreadsheet, ESRI service, WMS
    and WFS service. Link to Physical Sample Content Model: http://stategeothermaldata.org/data_delivery/content_models/physical_sample.",nt"license_title":
